import React from 'react';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import './App.css';
import Nav from './components/Nav';
import Header from './components/Header';
import About from './components/About';
import Events from './components/Events';
import AddEvent from './components/AddEvent';
import PostEvent from './components/PostEvent';
import Sidebar from './components/Sidebar';
import Footer from './components/Footer';
import Terms from './components/Terms';

function App() {
  return (
    <>
      <div>
        <Router>
          <div>
            <Nav />
            <Header />
            <Switch>
            <div className="float-left-area">
              <div className="inner-left">
                <Route path="/" exact component={Home} />
                <Route path="/about" component={About} />
                <Route path="/events" component={Events} />
                {/* <Route path="/events/addevent" component={AddEvent} /> */}
                <Route path="/events/postevent" component={PostEvent} />
                <Route path="/terms" component={Terms} />
                </div>
              </div>
              <div className="float-right-area">
                <div className="inner-right">
                    Right content. Add your images or sidebar text to this side.
                    <Sidebar />
                </div>
              </div>              
            </Switch>
            <Footer />
          </div>
        </Router>
      </div>
    </>
  );
}

const Home = () => (
  <div className="App">
    <h1>Home Page</h1>
    <div>
        <AddEvent />
    </div>
  </div>
);


export default App;
